{
    "(*.ts|*.tsx|*.js)": ["prettier --write", "eslint --fix"],
    "(*.scss|.css)": ["prettier --write", "stylelint --fix"],
    "(*.json|*.md|*.mdx|*.html|*.mjs|*.yml|*.svg)": "prettier --write",
    "package.json": "sort-package-json"
}

{
    "extends": ["@proton/stylelint-config-proton"]
}

import { danger, fail, markdown, warn } from 'danger';

const matchWhitespaceAtStartOfLine = /^\s+/gm;

const inboxFilesTouched = danger.git.fileMatch(
    'applications/mail',
    'applications/calendar',
    'packages/activation',
    'packages/mail-store',
    'packages/calendar-store',
    'packages/ai-assistant',
    'packages/llm'
);

const driveFilesMatch = danger.git.fileMatch('applications/drive');
const driveFilesTouched =
    driveFilesMatch.created || driveFilesMatch.edited || driveFilesMatch.deleted || driveFilesMatch.modified;

const docsFilesMatch = danger.git.fileMatch(
    'applications/docs',
    'applications/docs-editor',
    'packages/docs-core',
    'packages/docs-shared'
);
const docsFilesTouched =
    docsFilesMatch.created || docsFilesMatch.edited || docsFilesMatch.deleted || docsFilesMatch.modified;

/**
 * Fails if no assignee is provided.
 *
 * @param {Object} options - The options object.
 * @param {boolean} [options.disabled=false] - Indicates whether the check is disabled.
 * @returns {void}
 */
const failIfNoAssignees = ({ disabled = false }) => {
    if (disabled) return;

    if (!danger.gitlab.mr.assignees?.length) {
        fail('This pull request needs an assignee, and optionally include any reviewers.');
    }
};

/**
 * Fails if no description is provided.
 *
 * @param {Object} options - The options object.
 * @param {boolean} [options.disabled=false] - Indicates whether the check is disabled.
 * @returns {void}
 */
const failIfNoDescription = ({ disabled = false }) => {
    if (disabled) return;

    if (!danger.gitlab.mr.description) {
        fail('Merge request description is missing');
        markdown(
            `
            ## 🟠 Add an MR description

            Please consider adding a more [meaningful description](https://confluence.protontech.ch/display/~glinford/Writing+Meaningful+Merge+Request+Descriptions).
        `.replace(matchWhitespaceAtStartOfLine, '')
        );
    }
};

const warnIfSquashing = ({ disabled = false }) => {
    if (disabled) return;

    if (danger.gitlab.mr.squash) {
        warn('Commits will be squashed');
    }
};

const warnIfWIP = ({ disabled = false }) => {
    if (disabled) return;
    if (danger.gitlab.mr.title.includes('WIP') || danger.gitlab.mr.title.startsWith('Draft:')) {
        warn('PR is considered WIP');
    }
};

if (driveFilesTouched) {
    const expectedSection = [];

    if (!danger.gitlab.mr.description.includes('# Notes')) {
        expectedSection.push('`# Notes`');
    }

    if (!danger.gitlab.mr.description.includes('# Tests')) {
        expectedSection.push('`# Tests`');
    }

    if (!danger.gitlab.mr.description.includes('# Screenshots')) {
        expectedSection.push('`# Screenshots`');
    }

    if (expectedSection.length) {
        fail('Merge request description is missing required sections');
        markdown(`## 🔴 Merge request description is missing required sections`);
        markdown(`When modifying files in a 'drive' folder, the description must include:`);

        for (let i = 0; i < expectedSection.length; i++) {
            const section = expectedSection[i];
            markdown(section);
        }
    }
}

failIfNoDescription({ disabled: inboxFilesTouched || driveFilesTouched });
failIfNoAssignees({ disabled: inboxFilesTouched || docsFilesTouched });
warnIfSquashing({ disabled: docsFilesTouched || driveFilesMatch });
warnIfWIP({ disabled: driveFilesMatch });

const fileThresholdForLargePR = 200;
if (
    danger.git.created_files.length + danger.git.modified_files.length + danger.git.deleted_files.length >
    fileThresholdForLargePR
) {
    warn(
        'Merge Request size is pretty large. Consider splitting into separate MRs to enable a faster and easier review.'
    );
}

const TEST_FILES_GLOB = '**/*.{test,spec}.{js,ts,tsx,jsx}';

export default {
    packages: {
        glob: 'packages/*',
        directory: 'packages',
        globIgnore: [TEST_FILES_GLOB, '__mocks__'],
        alias: true,
        scope: '@proton',
        config: [
            {
                name: 'polyfill',
                glob: 'index.js',
            },
            {
                name: 'srp',
                glob: 'lib/**/*.{js,jsx,ts,tsx}',
            },
            {
                name: 'shared',
                glob: 'lib/**/*.{js,jsx,ts,tsx}',
            },
            {
                name: 'key-transparency',
                glob: 'lib/**/*.{js,jsx,ts,tsx}',
            },
            {
                name: 'encrypted-search',
                glob: 'lib/**/*.{js,jsx,ts,tsx}',
            },
            {
                name: 'drive-store',
                glob: '**/*.{js,jsx,ts,tsx}',
            },
            {
                name: 'docs-core',
                glob: '**/*.{js,jsx,ts,tsx}',
            },
            {
                name: 'docs-shared',
                glob: '**/*.{js,jsx,ts,tsx}',
            },
            {
                name: 'docs-proto',
                glob: '**/*.{js,jsx,ts,tsx}',
            },
            {
                name: 'docs-editor',
                glob: '**/*.{js,jsx,ts,tsx}',
            },
            {
                name: 'crypto',
                glob: 'lib/**/*.{js,jsx,ts,tsx}',
            },
            {
                name: 'cross-storage',
                glob: '{lib,*-impl}/**/*.{js,jsx,ts,tsx}',
            },
            {
                name: 'atoms',
                glob: '**/*.{js,jsx,ts,tsx}',
            },
            {
                name: 'hooks',
                glob: '**/*.{js,jsx,ts,tsx}',
            },
            {
                name: 'account',
                glob: '**/*.{js,jsx,ts,tsx}',
            },
            {
                name: 'mail',
                glob: '**/*.{js,jsx,ts,tsx}',
            },
            {
                name: 'calendar',
                glob: '**/*.{js,jsx,ts,tsx}',
            },
            {
                name: 'features',
                glob: '**/*.{js,jsx,ts,tsx}',
            },
            {
                name: 'utils',
                glob: '**/*.{js,jsx,ts,tsx}',
            },
            {
                name: 'colors',
                glob: '**/*.{js,jsx,ts,tsx}',
            },
            {
                name: 'components',
                glob: '{{components,containers,helpers,hooks}/**/*,index}.{js,jsx,ts,tsx}',
            },
            {
                name: 'encrypted-search',
                glob: 'lib/**/*.{js,jsx,ts,tsx}',
            },
            {
                name: 'activation',
                glob: '{src/**/*,index}.{js,jsx,ts,tsx}',
            },
            {
                name: 'sieve',
                glob: '{src/**/*,index}.{js,jsx,ts,tsx}',
            },
        ],
        ignore: ['pack', 'config', 'i18n', 'eslint-config-proton', 'stylelint-config-proton', 'styles', 'testing'],
    },

    applications: {
        glob: 'applications/*',
        directory: 'applications',
        globIgnore: [TEST_FILES_GLOB],
        sourcesGlob: 'src/app/**/*.{js,jsx,ts,tsx}',
        ignore: ['storybook', 'pass-extension', 'pass-desktop', 'preview-sandbox', 'pdf-ui'],
    },
};

module.exports = {
    testEnvironment: 'node',
    testMatch: ['**/__tests__/**/*.test.js'],
};

export default {
    printWidth: 120,
    arrowParens: 'always',
    singleQuote: true,
    // Default in prettier 3 is 'all', but since that'd require a large migration keeping it es5 for now
    trailingComma: 'es5',
    tabWidth: 4,
    proseWrap: 'never',
    overrides: [
        {
            files: '*.scss',
            options: {
                tabWidth: 2,
                useTabs: true,
                singleQuote: true,
            },
        },
        {
            files: '*.ts',
            options: {
                importOrderParserPlugins: ['typescript'],
            },
        },
        {
            files: '*.svg',
            options: {
                parser: 'html',
            },
        },
    ],
    importOrder: [
        '^react(.*)$',
        '^react-dom(.*)$',
        '^react-router-dom(.*)$',
        '<THIRD_PARTY_MODULES>',
        '^@proton/(.*)$',
        '^proton-mail(.*)$',
        '^[./].*(?<!\\.(c|sc)ss)$',
        '(c|sc)ss$',
    ],
    importOrderSeparation: true,
    importOrderSortSpecifiers: true,
    plugins: ['@trivago/prettier-plugin-sort-imports'],
};

{
    "$schema": "https://docs.renovatebot.com/renovate-schema.json",
    "extends": ["config:base", "group:allNonMajor", ":semanticCommitsDisabled"],
    "postUpdateOptions": ["yarnDedupeHighest"],
    "rangeStrategy": "bump",
    "rebaseWhen": "conflicted",
    "prConcurrentLimit": 2,
    "ignoreDeps": [
        "roosterjs",
        "emoji-mart",
        "@emoji-mart/data",
        "pmcrypto",
        "@openpgp/web-stream-tools",
        "@protontech/pass-rust-core",
        "@mlc-ai/web-llm",
        "sass"
    ],
    "ignorePaths": [
        "**/node_modules/**",
        "applications/pass-extension/safari/**",
        "applications/pass-desktop/native/**"
    ],
    "packageRules": [
        {
            "groupName": "Playwright",
            "matchPackageNames": ["playwright", "@playwright/test", "mcr.microsoft.com/playwright"]
        },
        {
            "groupName": "lexical",
            "matchPackagePatterns": ["@lexical/*", "lexical", "yjs", "y-protocols"]
        },
        {
            "groupName": "Unleash",
            "matchPackageNames": ["@unleash/proxy-client-react", "unleash-proxy-client"]
        },
        {
            "groupName": "pdfme",
            "matchPackagePatterns": ["@pdfme/*"]
        },
        {
            "groupName": "redux",
            "matchPackagePatterns": ["redux"]
        },
        {
            "groupName": "pass-desktop and inbox-desktop exclusions",
            "matchPackagePatterns": ["@electron-forge/*", "@electron/fuses", "@vercel/webpack-asset-relocator-loader"],
            "enabled": false
        }
    ]
}

{
    "compilerOptions": {
        "module": "commonjs",
        "target": "esnext",
        "esModuleInterop": true
    },
    "ts-node": {
        "ignore": ["/node_modules/(?!@proton)"]
    }
}

{
    "$schema": "https://turbo.build/schema.json",
    "globalEnv": ["APPLICATION", "CI_COMMIT_TAG"],
    "globalPassThroughEnv": [
        "http_proxy",
        "https_proxy",
        "no_proxy",
        "HTTP_PROXY",
        "HTTPS_PROXY",
        "NO_PROXY",
        "WEBPACK_PARALLELISM",
        "CI_COMMIT_SHA",
        "CI_COMMIT_REF_NAME",
        "SENTRY_ORG",
        "SENTRY_URL",
        "SENTRY_AUTH_TOKEN"
    ],
    "tasks": {
        "transit": {
            "dependsOn": ["^transit"]
        },
        "@proton/i18n#build": {},
        "build:web": {
            "outputs": ["dist/**", "webapp-bundle.tar.gz"]
        },
        "test:ci": {
            "dependsOn": ["transit"]
        },
        "test:coverage": {
            "outputs": ["coverage/**"]
        },
        "lint": {},
        "i18n:validate": {},
        "i18n:extract:web": {
            "dependsOn": ["@proton/i18n#build", "build:web"],
            "outputs": ["po/**"]
        },
        "i18n:validate:context:web": {
            "inputs": ["po/**"]
        },
        "check-types": {
            "dependsOn": ["transit"]
        },
        "dev": {
            "cache": false,
            "persistent": true
        }
    }
}
